import React, {Component} from 'react';
import Miniaboutui from "./Miniaboutui";

class AboutUi extends Component {
    render() {
        return (
            <div class="how-section1">
                <Miniaboutui uiimgtop="../img/respon.jpg" uititletop="Tương thích với mọi thiết bị" uicontenttop="Tất cả các trang web do chúng tôi thiết kế đều đảm bảo responsive. Dù sử dụng thiết bị mobile , ipad hay laptop cũng đều hiển thị đúng chuẩn không hề bị phá vỡ thiết kế" uititlebot="Đa dạng thể loại" uicontentbot="Chúng tôi có các mẫu giao diện thoả sức cho bạn lựa chọn. Hãy tìm cho mnh một trang web phù hợp nào!" uiimgbot="../img/catermore.jpg"/>
                <Miniaboutui uiimgtop="../img/uppspeed.jpg" uititletop="Tốc độ tải trang cực nhanh" uicontenttop="Bằng việc sử dụng framework chúng tôi sẽ mang lại cho trang web của bạn tốc độ tải trang nhanh nhất có thể" uititlebot="Giá hấp dẫn nhất" uicontentbot="Bạn sẽ không thấy ở đâu có mức giá hợp lý như ở đây. Mọi thứ rẻ hơn bao giờ hết" uiimgbot="../img/price.jpg"/>
            </div>
        );
    }
}

export default AboutUi;
